} from "rxjs/operators";
interface TeamObject {
  user_id: number;
  type: number;
}
import data from 'jquery';

export interface emp {
  id: string;
  name: string;
}

@Component({
  selector: 'app-meeting',
  templateUrl: './meeting.component.html',
  styleUrls: ['./meeting.component.scss']
})
export class MeetingComponent implements OnInit {

  send_value: string;

  meetList: any;
  pagesizemeetlog = 10;

  meetView: any;
  // pagesizeviewlog = 10;

